import React from "react"

const Annocument = () => {
  const mystyle = {
    width: "30%",
    height: "340px",
  }
  const mystyle1 = {
    width: "68%",
    height: "340px",
  }
  return (
    <>
      <section className='annocument background'>
        <div className='container d_flex'>
          <h4>Ime kompanije</h4>
          <input></input>
        </div>
      </section>
    </>
  )
}

export default Annocument
